// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ImageHashStore {
    mapping(uint256 => string) public imageHashes;
    uint256 public imageCount = 0;

    function storeImageHash(string memory hash) public {
        imageHashes[imageCount] = hash;
        imageCount++;
    }

    function getImageHash(uint256 index) public view returns (string memory) {
        return imageHashes[index];
    }
}
